institutions:
Maritime Authority Suriname: hydrographic research conducts regulation of shipping legislation
and activities;
· Ministry of Agriculture, Animal Husbandry & Fisheries; department of Fisheries applies
sustainable fisheries management & legislation;
· Anton de Kom University of Suriname: departments of mining and infrastructure conduct
research for educational reasons;
Ministry of Spacial Planning, Land & Forest Management: Nature Conservation Division works
on coastal zone management until 10m depth off-shore;
· Ministry of Public Works; will be involved in protection of the shoreline by building
dykes
· State Oil Company Suriname; conducts ocean surveys with regard to oil extraction from
the ocean bottom;
· Ministry of Natural Resources
· National Institute for Environmental Development in Suriname (NIMOS): this institute
conducts approval of ESIA’s conducted by others such as companies and or individuals
etc.
